from binascii import hexlify
def bin2Frames(binText,Framelength):
    res = []
    leng = len(binText)
    tempFrame = []
    tempFramelen = 0
    while(leng>0):
        if(tempFramelen!=Framelength):
            tempFrame.append(binText[0:8])
            binText = binText[8:]
            tempFramelen+=1
            leng-=8
        else:
            res.append(tempFrame)
            tempFrame=[]
            tempFramelen=0
    if(res==[] or tempFrame!=res[-1]):
        res.append(tempFrame)
    return res

#s = ''
s = '1111111100000000111111110000000011111111000000001111111100000000'
print(bin2Frames(s,6))